import {Card,Container, Button, Navbar,Nav, Row, Col} from 'react-bootstrap'






const Footer = () => {


  return (  
    <footer>
 <Row>
     <Col className="col-9">
     <a>LOGO</a>
         <a>Promo code</a>
         <a>Promo code</a>
         <a>Promo code</a>
         <a>Promo code</a>
     </Col>
     <Col className="col-3">
     </Col>
 </Row>
    </footer>
  );
}


export default Footer;
